window.bookSummaryJSON = "<p><b>Visions of the war to come. Alliances on the open water. Sink or swim.</b></p> <p>Zeke and the team are one step closer to their goals of defeating War’s generals and freeing Brindolla for good. Storm Company’s return from the Great Below was harrowing, nearly as bad as the time they had to spend there.</p> <p>Though they bear the scars of their journey, it’s finally time to sniff out War’s generals wherever they might hide - including across the ocean in the mysterious continent of beasts.</p> <p>Plots thicken like the clouds over the water, and the group begins to realize the currents and intrigue they will have to navigate successfully if they want to survive sailing into the storm.</p>"; 
